I want to make a drawing React NAME_1. here is my code so far:
```
import { useRef, useState, useEffect } from 'react'
import './NAME_1.css'

const NAME_1 = () => {
  const [drawing, setDrawing] = useState(false);
  const canvasRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    ctx.lineJoin = 'round';
    ctx.lineCap = 'round';
    ctx.lineWidth = 3;
  }, []);

  const startDrawing = (event) => {
    const { offsetX, offsetY } = event.nativeEvent;
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    ctx.beginPath();
    ctx.moveTo(offsetX, offsetY);
    setDrawing(true);
  };

  const draw = (event) => {
    if (!drawing) return;
    const { offsetX, offsetY } = event.nativeEvent;
    const { clientX, clientY } = event;
    const rect = event.target.getBoundingClientRect();
    const prevX = offsetX;
    const prevY = offsetY;
    const currX = clientX - rect.left;
    const currY = clientY - rect.top;

    const x = (prevX + currX) / 2;
    const y = (prevY + currY) / 2;

    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');

    ctx.quadraticCurveTo(prevX, prevY, x, y);
    ctx.stroke();

    ctx.beginPath();
    ctx.moveTo(x, y);
  };

  const stopDrawing = () => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    ctx.closePath();
    setDrawing(false);
  };

  const clearCanvas = () => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');
    ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height);
  };

  return (
    <div>
      <canvas
        ref={canvasRef}
        onMouseDown={startDrawing}
        onMouseMove={draw}
        onMouseUp={stopDrawing}
        onMouseLeave={stopDrawing}
        width={600}
        height={400}
        style={{ border: '1px solid black' }}
      />
      <button onClick={clearCanvas}>Clear</button>
    </div>
  );
};


export default NAME_1
```

